import { StyleSheet, View } from 'react-native';
import { auth } from "../firebase";
import EditScreenInfo from '../components/EditScreenInfo';
import { Button, ButtonGroup, withTheme, Text, Input } from 'react-native-elements';
import { SettingStackParamList, RootTabParamList, SettingStackProps } from '../types';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import SettingScreen from '../screens/SettingScreen';
import CreatePostScreen from '../screens/CreatePostScreen';
const Stack = createNativeStackNavigator<SettingStackParamList>();

export default function SettingsScreen({ navigation }: SettingStackProps<'Setting'>) {
  return (
    <Stack.Navigator>
      <Stack.Screen options={{ headerShown: false }} name="Setting" component={SettingScreen}
      ></Stack.Screen>
      <Stack.Screen name="CreatePost" component={CreatePostScreen}
        options={{
          title: 'Tab Two',
          headerRight: () => (
            <Button
              loading={false}
              loadingProps={{ size: 'small', color: 'white' }}
              buttonStyle={{
                backgroundColor: '#0a9396',
                borderRadius: 5,
              }}
              containerStyle={{
                marginHorizontal: 50,
                height: 50,
                width: 200,
                marginVertical: 10,
              }}
              onPress={navigation.goBack()}
              title="Register" />
          ),
        }}
      ></Stack.Screen>
    </Stack.Navigator>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  title: {
    fontSize: 20,
    fontWeight: 'bold',
  },
  separator: {
    marginVertical: 30,
    height: 1,
    width: '80%',
  },
});
